import React from "react";
import {Table, Button, Col, Card, CardBody} from "reactstrap";
import {Edit, Plus, Trash2} from 'react-feather';
import Translate from "../../Translate";

export default class TableComponent extends React.Component {
    render() {
        let data = this.props.data
        if (data.length) {
            return (

                <Table responsive>
                    <thead>
                    <tr>
                        {Object.keys(data[0]).map((key) => <td key={key}>{key}</td>)}
                        <th>Actions</th>
                    </tr>
                    </thead>
                    <tbody>
                    {data.map((value, index) =>
                        <tr key={index}>
                            {Object.keys(value).map((key) => <td key={key}>{value[key]}</td>)}
                            <td><Edit size={18} className="mr-2"/> <Trash2 size={18} color="#FF586B"/></td>
                        </tr>
                    )}
                    </tbody>
                </Table>

            );
        } else {
            return (
                <div></div>
            )
        }
    }
}
